INSERT INTO `sp_show` VALUES (4, '238879937', '7321424279', 'Oxbow Natural Science Digestive Support (4.2 oz) - 120 g', '27 Sold', 'RM63.90', 'RM60.70', 'Natural Science Digestive Support is a high-fiber supplement containing various herbal ingredients to support the digestive health of your pet. Chicory Root supports the growth of beneficial bacteria in the GI tract while Ginger Root supports gastric motility. Slippery Elm supports overall digestive function.\n\nGuaranteed Analysis:\nCrude Protein (min): 12.00%\nCrude Fat (min): 4.00%\nCrude Fiber (min): 8.00%\nCrude Fiber (max): 12.00%\nMoisture (max): 10.00%\nAsh (max): 6.00%\nCalcium (min): 0.35%\nCalcium (max): 0.55%\nPhosphorus (min): 0.30%\nCopper (min): 8 mg/kg\n\nIngredients:\nTimothy Grass, Barley Flour, Oat Groat Flour, Cane Molasses, Flax Seed Meal, Chamomile, Fenugreek Seed, Brewers Dried Yeast, Dried Chicory Root (Source of Inulin), Ginger Root, Guar Gum, Hydrolyzed Yeast, Fat Product, Mixed Tocopherols (preservative), Rosemary Extract\n\nFeeding Directions:\nRabbits, Guinea Pigs, and Chinchillas: 0-1 lb: 1/2 tab per day 1-4 lb: 1 tab per day 4 lb & over: 2 tabs per day\nRats (all weights): 1/4 tab per day\nOther Species: Contact Oxbow or consult your veterinarian\n\n*Not intended for growing, pregnant, lactating or food producing animals.', '7 months', '[\"https://cf.shopee.com.my/file/5410df6e0369a6af2e795a579b662dce\", \"https://cf.shopee.com.my/file/eb9be69f18e132ca4e0dec2380c1f142\"]', 'https://shopee.com.my/Oxbow-Natural-Science-Digestive-Support-(4.2-oz)-120-g-i.238879937.7321424279', 37, 1, 'Preferred', 'Selangor', NULL, 'behnyo', NULL, 1602929521, NULL);
INSERT INTO `sp_show` VALUES (5, '157936248', '6405756753', 'Oxbow Natural Science Critical Care For Chinchilla/Herbivorous Reptiles/Hamster/Guinea Pig/Rabbits/Herbivorous Pets 36G', '11 Sold', NULL, 'RM40.00', 'Developed with the assistance of top exotics veterinarians and nutritionists, Critical Care is the industry standard in recovery nutrition for herbivores with poor nutritional status resulting from illness or surgery.  Critical Care contains all the essential nutrients of a complete diet, as well as high-fiber timothy hay to support proper gut physiology and digestion.\n\nProduct Highlights:\n~ Powdered formula mixes easily to desired consistency\n~ Highly versatile ‚Äì can be tube fed, assist-fed by syringe or spoon, or self-fed by bowl or as top dressing\n~ High in fiber; low in carbohydrates\n~ Contains readily-absorbable chelated minerals and beneficial prebiotics\n~ No refined sugars, artificial preservatives or simple carbohydrates\n~ High digestibility and palatability\n~ Contains stabilized form of Vitamin C\n\nFeeding Directions: If you have never syringe fed before, be sure to get proper instruction from your vet so you do not accidentally cause aspiration. \n\n~ Shake well before using.  \n~ Mix 1 part Critical Care with 2 parts warm water to the desired consistency. \n~ The volume of water may be adjusted depending on feeding method.  \n~ Herbivorous mammals: Mix 3 Tbsp per kg of body weight daily.  (1 Tbsp is equal to approximately 9 grams.)   \n~ Herbivorous reptiles: Mix 1 Tbsp per kg of body weight daily.  \n~ Amounts are general guidelines.  Divide into 4 to 6 feedings unless specified by your veterinarian. Water should be available to the animal at all times. Prepare fresh at each feeding; discard after 24 hours. \n~ Store in a cool, dry place.', '11 months', '[\"https://cf.shopee.com.my/file/bb23956d16587246ccff6e6eff7d461c\", \"https://cf.shopee.com.my/file/2a874dfa7aeccdc1a2a2397289484e75\"]', 'https://shopee.com.my/Oxbow-Natural-Science-Critical-Care-For-Chinchilla-Herbivorous-Reptiles-Hamster-Guinea-Pig-Rabbits-Herbivorous-Pets-36G-i.157936248.6405756753', 36, 1, NULL, 'Selangor', NULL, 'petsstar.com.my', NULL, 1602929521, NULL);
