INSERT INTO `sp_show` VALUES (8, '73054533', '1381975646', 'OXBOW‚Ñ¢ ESSENTIALS Adult Guinea Pig Food - 5lbs (2.25kg)', '172 Sold', 'RM70.90', 'RM67.35', 'OXBOW‚Ñ¢ ESSENTIALS Adult Guinea Pig Food\n***[Expiry Date : 05/04/2022]***\n\nFEATURES :\n> A complete & balanced adult guinea pig food.\n> RECOMMENDED by Veterinarians worldwide.\n> Formulated to meet the specific nutritional needs of adult guinea pigs to support daily function and performance.\n>  Lower level of protein, calories & calcium than alfalfa-based pellets\n> Uniform pellets prevent selective feeding.\n> High in fiber for daily digestive health.\n> Fortified with vitamins & minerals for optimum health.\n> Contains stabilized Vitamin C.\n> An optimal calcium-to-phosphorus ratio that helps maintain a healthy body. \n> Formulated with the guidance of top veterinarians & nutritionists.\n> Ideal for Adult Guinea Pig (Age over 6months).\n\nSUGGESTED FEEDING :\n1. At least 70% of your guinea pig\'s diet should be grass hay.\n2. Feed 20g of OXBOW‚Ñ¢ ESSENTIALS Adult Guinea Pig Food daily, with unlimited fresh grass hay. \n3. Choose from Oxbow‚Äôs Western Timothy, Orchard, Oat or Botanical grass hays to provide additional natural fiber. \n\nHOW TO SWITCH YOUR GUINEA PIG DIET :\nWEEK 1 : Mix 1/4 of new food with 3/4 current food.\nWEEK 2 : Mix 1/2 of new food with 1/2 current food.\nWEEK 3 : Mix 3/4 of new food with 1/4 current food.\nWEEK 4 : You can feed OXBOW‚Ñ¢ ESSENTIALS Adult Guinea Pig Food exclusively to your guinea pigs.\n\n* Volume Available : 5lbs (2.25kg), 10lbs (4.53kg).\n* PRODUCT OF THE USA.\n\nhttps://www.facebook.com/EcoSpherePetOnlineStore/', '26 months', '[\"https://cf.shopee.com.my/file/c7acf7aa107c32d5a19e323d97cbd09d\", \"https://cf.shopee.com.my/file/6995f38f3797dcf573f248476f8e888d\"]', 'https://shopee.com.my/OXBOW%E2%84%A2-ESSENTIALS-Adult-Guinea-Pig-Food-5lbs-(2.25kg)-i.73054533.1381975646', 33, 1, 'Preferred', 'Kuala Lumpur', NULL, 'ecosphere_pet_online_store', NULL, 1602929521, NULL)