INSERT INTO `sp_show` VALUES (39, '215796164', '5015174223', 'OXBOW‚Ñ¢ Essentials Hamster & Gerbil Food - 1lb (454g)', '18 Sold', NULL, 'RM33.00', 'OXBOW‚Ñ¢ Essentials Hamster & Gerbil Food\n\n\nFEATURES :\n> Hamsters & gerbils love this blend of timothy hay, oats & barley.\n> A complete, stabilized feed with optimally balanced nutrients.\n> Help maintain proper nutrition, weight, digestive function, dental health & quality of life for active pets.\n> All natural with vitamins & minerals.\n> Includes a high level of fiber for digestive mobility.\n> DOES NOT include seeds, high-sugar fruits, or artificial preservatives, colors & flavors.\n> Kibble only to prevent selective eating.\n> Not intended for pregnant or nursing females.\n> Serve with Oxbow hays to encourage foraging and provide enrichment.\n> RECOMMENDED by Veterinarians worldwide.\n\nPREMIUM INGREDIENTS :\n‚Ä¢ Timothy Hay = Beneficial Fiber\n‚Ä¢ Oat and Barley = Superior Energy Source\n‚Ä¢ Canola Products = Complete Protein & Healthy Fat\n\nSUGGESTED FEEDING :\n1. FOR YOUNG (UNDER 6 MONTHS)\nSmall Hamster : Unlimited Feeding.\nGerbils & Large Hamster : Unlimited Feeding.\n2. FOR PREGNANT/NURSING :\nSmall Hamster : Unlimited Feeding.\nGerbil & Large Hamster : Unlimited Feeding.\n3. FOR ADULT (OVER 6 MONTHS)\nSmall Hamster : 1/8 Cups.\nGerbil & Large Hamster : 1/3 Cups.\n\nA BALANCE DIET INCLUDES :\n75% - Fortified Food.\n20% - Mix of veggies, greens & fruits. \n5% - Treats.\nUnlimited - Fresh Water.\n\nTRANSITIONING FOODS\nWEEK 1 : 1/4 New Food + 3/4 Current Food\nWEEK 2 : 1/2 New Food + 1/2 Current Food\nWEEK 3 : 3/4 New Food + 1/4 Current Food\nWEEK 4 : You can feed Oxbow Essentials Hamster & Gerbil Food exclusively to your pet.\n\n* Product Volume : 1lb (454g)\n* PRODUCT OF THE USA', '9 months', '[\"https://cf.shopee.com.my/file/363a30d39967e5204c7f84344fac6d40\", \"https://cf.shopee.com.my/file/cc564f23298c8d3fdabf8e9479e8e65f\"]', 'https://shopee.com.my/OXBOW%E2%84%A2-Essentials-Hamster-Gerbil-Food-1lb-(454g)-i.215796164.5015174223', 129, 2, 'Preferred', 'Selangor', NULL, 'amypets', NULL, 1602929521, NULL);
INSERT INTO `sp_show` VALUES (40, '99864607', '4854689317', 'Clearance Animal Pak Multivitamin', '0 Sold', NULL, 'RM155.00', 'Universal Animal Pak has been the #1 selling multivitamin ‚Äútraining pack‚Äù since it‚Äôs introduction in 1983. For over 30 years, the legendary Animal Pak has been the choice of hardcore bodybuilders and powerlifters. Why? Because it simply works. Animal Pak was designed to cover all the nutritional basics the dedicated lifter needs and then some.\n\nPacked with all the essential vitamins and minerals a competitive athlete needs, it also mega doses anabolic amino acids, anti-oxidants and all the goodies that most multivitamin formulas haven‚Äôt even thought of. Performance optimizers like pyridoxine alpha-ketoglutarate (PAK), carnitine, lipotropics, L-arginine, alpha lipoic acid, eleuthero are just some of these that the ‚Äòaverage‚Äô multivitamin can‚Äôt touch. You‚Äôre not an average joe, so why take a plain multivitamin designed for one?\n\nEach pack consists of 11 tablets. While that seems like a lot to take, Animal Pak is packed with a lot. That‚Äôs what Animal takes pride in. Creating a full and well-rounded product and skimping on nothing. Especially when it comes to an essential health supplement that‚Äôs the foundation of every supplement stack like a multi-vitamin.\n\nUniversal Animal Pak knows that over time from training or especially prepping for a contest, there‚Äôs going to be some nutritional gaps. These, while small at the beginning can lead to plateaus in the long run and hinder your progress and leave you short of your potential. Why roll the dice when it comes to getting the best results possible when you can ensure you‚Äôre getting all you need and then some with the tried and true Animal Pak. Enhance your recovery and elevate your performance.\n\nAnimal Pak is produced in a U.S.A. cGMP manufacturing facility. This means what‚Äôs on the label is in the product.\n\nPRODUCT HIGHLIGHTS\nThe ‚ÄúTrue Original‚Äù Multivitamin Training Pack\nDesigned to limit micronutrient deficiencies optimizing the internal anabolic environment\nThe choice of bodybuilding and powerlifting champions for over 30 years\nPacked with vitamins, minerals, amino acids, digestive enzymes, and anti-oxidants\nOver 60 ingredients per pack#animalpak\n\n#multivitamin\n#wheyprotein\n#weightgain\n#weightgainner\n#sayajualproteinmurah\n#malaysiamuscle\n#tegap\n#sado\n#tegaptv\n#tegaptvmalaysia\n#katang', '19 days', '[\"https://cf.shopee.com.my/file/cfeb279859b9a12a68b4186a679833d9\", \"https://cf.shopee.com.my/file/61cabc2f956931b4bf14378f6348c870\"]', 'https://shopee.com.my/Clearance-Animal-Pak-Multivitamin-i.99864607.4854689317', 128, 2, NULL, 'Terengganu', NULL, 'miasupplement', NULL, 1602929521, NULL);
INSERT INTO `sp_show` VALUES (41, '99136465', '4833217545', 'Oxbow Western Timothy Hay 15OZ', '0 Sold', NULL, 'RM29.90', 'Oxbow‚Äôs all-natural Western Timothy Hay is a nutritious, sweet-smelling grass that will stimulate the appetite of your rabbit, guinea pig, chinchilla, or other small pet. ¬†Western Timothy is the #1 vet-recommended hay for small herbivores.\n\nProduct Highlights\nHarvested fresh from our family of farms\nHand-sorted and hand-packed with care\nProvides essential fiber to support digestive & dental health\nNo artificial colors, flavors, or preservatives\n\nFeeding Guidelines\nPlace large handfuls of grass hay in your pet‚Äôs habitat daily. Mix different grass hays together to enrich your pet‚Äôs diet. Try all tastes and textures to discover your pet‚Äôs favorites.\n\nGuaranteed Analysis\nCrude Protein (min) 7.00%\nCrude Fat (min) 1.50%\nCrude Fiber (max) 32.00%\nMoisture (max) 15.00%', '5 months', '[\"https://cf.shopee.com.my/file/0ff98e45180951bb8e1cb2a7b60ac38f\"]', 'https://shopee.com.my/Oxbow-Western-Timothy-Hay-15OZ-i.99136465.4833217545', 127, 2, 'Preferred', 'Kuala Lumpur', NULL, 'petico.my', NULL, 1602929521, NULL);
INSERT INTO `sp_show` VALUES (42, '238879937', '7121413642', 'Oxbow Alfalfa Hay (15 oz) - 425 g', '36 Sold', 'RM32.90', 'RM31.25', 'Oxbow Alfalfa Hay is a high-fiber legume hay with the same long-strand fiber found in grass hays, but with more protein, energy and calcium. This hay is perfect for young or lactating animals that need concentrated nutrition. The succulent taste stimulates the appetite of ill or post-surgical animals. Once an animal reaches adulthood or completes recovery, this nutritious forage should be replaced with a grass hay. Alfalfa Hay, mixed with any other Oxbow grass hay, creates a rich, flavorful and nutritious treat.\n\nIngredients:\n100% Alfalfa Hay. Preservative and additive free.\nLoose hay contains stems, leaves, and limited seed heads.\n\nGuaranteed Analysis:\nCrude Protein min 16.00%\nCrude Fat min 1.50%\nCrude Fiber max 32.00%\nMoisture max 15.00%\n\nFeeding Directions:\nGrowing Animals (under 6 months): Unlimited amounts, plus free choice grass hay.\nMature Animals: Occasional small amounts.\nNursing Females: Unlimited amounts in addition to free choice grass hay.\n\nAlfalfa Hay should only be offered carefully to mature rabbits, guinea pigs, chinchillas, and prairie dogs due to the higher protein and calcium content.\nMany vets believe that animals prone to kidney stones, bladder stones or calcium crystals in their urine should always avoid alfalfa.\n\nAlfalfa Hay can be used to help animals gain weight and will give a nice shine to their fur.\nElderly animals should be fed foods they enjoy, such as alfalfa, when considering quality of life.\nAlfalfa Hay can be used in small amounts as an appetite stimulant for thin or convalescing animals.\nRabbits, guinea pigs and chinchillas under six months of age can be given Alfalfa Hay daily.\nAfter six months of age an animal should begin a gradual transition to 100% grass hay such as Oat Hay, Western Timothy or Orchard Grass.', '7 months', '[\"https://cf.shopee.com.my/file/b9a42cd959476845304ab4a954999179\", \"https://cf.shopee.com.my/file/0740e5fc6fd92700d846e8acfb6b7862\"]', 'https://shopee.com.my/Oxbow-Alfalfa-Hay-(15-oz)-425-g-i.238879937.7121413642', 126, 2, 'Preferred', 'Selangor', NULL, 'behnyo', NULL, 1602929521, NULL);
