INSERT INTO `sp_show` VALUES (44, '73054533', '1788732156', 'OXBOW‚Ñ¢ Orchard Grass Hay 40oz (1.13kg)', '117 Sold', 'RM67.90', 'RM64.50', 'OXBOW‚Ñ¢ Orchard Grass Hay\n***[Freshest By : 27/03/2022]***\n\nFEATURES :\n> Aromatic & high-fiber Orchard Grass Hay.\n> Harvested fresh from our family of farms.\n> No artificial colors, flavors, or preservatives.\n> A sweet smell & soft texture that rabbits, guinea pigs, chinchillas & other small pets.\n> The fragrant aroma of Orchard Grass Hay will stimulate your pet‚Äôs appetite & encourage consumption. \n> Provides essential fiber to support digestive & dental health.\n> Preventing obesity.\n> Hand-sorted and hand-packed with care.\n> Loose hay contains stems, leaves, & limited seed heads.\n> Can be fed free choice to rabbits, guinea pigs, chinchillas, prairie dogs, gerbils, hamsters, mice, rats & other herbivores as an alternative to timothy, oat hay & brome. \n\nINGREDIENTS :\nOrchard Grass Hay.\n\nGUARANTEED ANALYSIS :\n- Crude Protein (min) 7.00%\n- Crude Fat (min) 1.50%\n- Crude Fiber (max) 32.00%\n- Moisture (max) 15.00%\n\nSUGGESTED FEEDING :\n1. Place large handfuls of grass hay in your pet‚Äôs habitat daily. \n2. Mix different grass hays together to enrich your pet‚Äôs diet. \n3. Try all tastes and textures to discover your pet‚Äôs favorites.\n4. Your pet should have unlimited grass hay every day.\n\n* Product Volume Available : 15oz (425g), 40oz (1.13kg).\n* GRASS GROWN IN THE USA.\n\nhttps://www.facebook.com/EcoSpherePetOnlineStore/', '22 months', '[\"https://cf.shopee.com.my/file/0aaa2728ad92df22aee554d0afa2ab54\"]', 'https://shopee.com.my/OXBOW%E2%84%A2-Orchard-Grass-Hay-40oz-(1.13kg)-i.73054533.1788732156', 124, 2, 'Preferred', 'Kuala Lumpur', NULL, 'ecosphere_pet_online_store', NULL, 1602929521, NULL);
INSERT INTO `sp_show` VALUES (45, '149529109', '7300402591', 'Painting By Numbers Cartoon Japan Anime On Canvas Acrylic Paint Digital Module Picture Coloring Package DIY', '13 Sold', 'RM38.88 - RM78.88', 'RM23.32 - RM47.32', 'Hi, welcome to SMALL&CO ART PAINTING.\n\nTips:\nThis product is not finished painting, you need to paint by yourself!Painting is relatively simple, the paint box and the canvas have been marked with code, the corresponding code area paint corresponding Numbers can be done.(no painting basics required!)\n\nProduct Parameters:\nProduct Name: DIY Painting By Numbers\nProduct Size: 40cm*50cm/50cm*65cm  (15.75in*19.69in / 19.69in*25.60in)\nProduct Canvas: White Canvas\nProduct Paint: Acrylic Paint\nProduct Brushes: Nylon Brushes\nInner Frame: No Inner Frame And DIY Inner Frame \n\nPainting Description:\n1. Prepare a water glass for cleaning brushes and diluting paint. If you don\'t want your desk to get dirty, place some newspaper under the canvas.\n2. Open the package, take out the canvas and paint marked with Numbers, and paint the digital codes on the paint and the digital codes on the canvas one by one.\n3. It is suggested to start with a light color, such as white, light yellow, etc.As a result of acrylic pigment coverage even if painted wrong just as well, you can wait for pigment dry after dark cover modification.\n4. As it is difficult to cover the black digital coding with light pigments, you can apply it several times, but repeat it after the paint dries.The paint should be as thick as possible to give the effect of an oil painting and keep the strokes in the same direction as possible.\n5. When applying paint, please pay attention to the color pressure and cover the black lines of the color block to ensure the authenticity of the painting.\n6. When not painting, the lid of the paint box should be closed properly to avoid paint drying.Acrylic paint is water-soluble, even if the paint is dry, you can add a little water to dissolve, after stirring can continue to use.\n\nNote:\n1. As the product size is measured manually, there may be an error of 0 ~ 2cm, which is a normal phenomenon.\n2. Different from other commodities, the effect of each person\'s painting is not quite the same, because the factors that determine the final effect are related to each person\'s degree of care and painting technique, and there will be differences after the painting is finished, so please forgive me.\n3.At present, there are no exquisite retail packages.\n\nPackage List:\nA.40cm*50cm/50cm*65cm (No Inner Frame)\nWhite Canvas *1 Piece\nAcrylic Paint *1 Set\nNylon Brushes *3\nProduct Picture *1\nScrews *2\nHook * 2\n\nB.40cm*50cm/50cm*65cm (With Inner Frame)\nWhite Canvas *1 Piece\nAcrylic Paint *1 Set\nNylon Brushes *3\nProduct Picture *1\nInner Frame *1 Set\nInstallation Accessories *1 Set', '12 months', '[\"https://cf.shopee.com.my/file/7f656c69c3006f25300749d764e4002e\", \"https://cf.shopee.com.my/file/963c3b8163737329fc52960a2f4c4d02\"]', 'https://shopee.com.my/Painting-By-Numbers-Cartoon-Japan-Anime-On-Canvas-Acrylic-Paint-Digital-Module-Picture-Coloring-Package-DIY-i.149529109.7300402591', 150, 2, NULL, 'Overseas', NULL, '13510381032.my', NULL, 1602929521, NULL);
