INSERT INTO `sp_show` VALUES (50, '300342016', '6655559472', 'Oxbow Hamster&Gerbil Food', '0 Sold', NULL, 'RM34.88', 'Hamsters and gerbils love this blend of timothy hay, oats and barley. Healthy Handfuls ‚Äì Hamster and Gerbil Food is a complete, stabilized feed with optimally balanced nutrients that help maintain proper nutrition, weight, digestive function, dental health and quality of life for active pets. It includes a high level of fiber for digestive mobility. It does not include seeds, high-sugar fruits, or artificial preservatives, colors and flavors. Healthy Handfuls ‚Äì Hamster and Gerbil Food is not intended for pregnant or nursing females. Serve with Oxbow hays to encourage foraging and provide enrichment.\n\nPremium Ingredients:\n‚Ä¢Timothy Hay = Beneficial Fiber\n‚Ä¢Oat and Barley = Superior Energy Source\n‚Ä¢Canola Products = Complete Protein and Healthy Fat\n\nIngredients:\nTimothy Meal, Pearled Barley (Rolled), Oat Groats, Linseed (Flax) Meal, Canola Meal, Wheat Gluten, Millet, Ground Flax Seed, Canola Oil, Limestone, Salt, Dried Yeast Culture (Saccharomyces cerevisiae), Vitamin E Supplement, Choline Chloride, Zinc Proteinate, Zinc Sulfate, Ferrous Sulfate, Niacin, Copper Sulfate, Selenium Yeast, Vitamin A Supplement, Folic Acid, d-Calcium Pantothenate, Copper Proteinate, Riboflavin Supplement, Manganese Proteinate, Biotin, Manganous Oxide, Thiamine Mononitrate, Magnesium Sulfate, Vitamin B12 Supplement, Sodium Selenite, Pyridoxine Hydrochloride, Cobalt Carbonate, Vitamin D3 Supplement, Calcium Iodate, Mixed Tocopherols, Rosemary Extract\n\nGuaranteed Analysis:\n‚Ä¢Crude Protein (min) 17.00%\n‚Ä¢Crude Fat (min) 4.50%\n‚Ä¢Crude Fiber (min) 11.00%\n‚Ä¢Crude Fiber (max) 15.00%\n‚Ä¢Moisture (max) 10.00%\n‚Ä¢Calcium (min) 0.60%\n‚Ä¢Calcium (max) 1.00%\n‚Ä¢Phosphorus (min) 0.40%\n‚Ä¢Salt (min) 0.50%\n‚Ä¢Salt (max) 1.00%\n‚Ä¢Copper (min) 25 ppm\n‚Ä¢Vitamin A (min) 19,000 IU/kg\n‚Ä¢Vitamin D (min) 900 IU/kg\n‚Ä¢Vitamin E (min) 190 IU/kg\n\nFeeding Directions:\nHamsters are known to hoard and hide their food, particularly females or those housed with other hamsters. Be sure to check for stockpiles of food and adjust daily rations as required. This information is meant to be used as a guideline. Individual needs may vary. If your pet is overweight, underweight, or has a medical condition, please contact your veterinarian for more specific feeding information.', '13 days', '[\"https://cf.shopee.com.my/file/9b651be1359521471139531f56aa6a15\", \"https://cf.shopee.com.my/file/71da617841a41ecaabe84966e8104952\"]', 'https://shopee.com.my/Oxbow-Hamster-Gerbil-Food-i.300342016.6655559472', 145, 2, NULL, 'Melaka', NULL, 'catng8888', NULL, 1602929521, NULL);
