INSERT INTO `sp_show` VALUES (56, '30912019', '6540903633', 'Oxbow hamsters and Gerbils food Áà±ÂÆùËçâÂúà Repack', '5 Sold', NULL, 'RM4.00', 'Oxbow for hamsters Áà±ÂÆùËçâÂúà\nOxbow‚Äôs Essentials - Hamster & Gerbil Food is formulated with the guidance of top exotics veterinarians to meet your pet hamster or gerbil‚Äôs unique nutritional needs. We combine hand-selected Timothy Hay with wholesome barley and oats to provide vital nutrients that support daily function and performance in hamsters and gerbils.\n\nProduct Highlights:\n\nUniform kibble prevents selective feeding¬†\n\nSupports daily function and performance in hamsters and gerbils\n\nFortified with vitamins and minerals for optimum health\n\nFormulated with the guidance of top veterinarians and nutritionists\n\n', '3 months', '[\"https://cf.shopee.com.my/file/ec4d547893902c7885b3055baf5bd99a\", \"https://cf.shopee.com.my/file/19feaac6754b785abf117f0cac643c85\"]', 'https://shopee.com.my/Oxbow-hamsters-and-Gerbils-food-%E7%88%B1%E5%AE%9D%E8%8D%89%E5%9C%88-Repack-i.30912019.6540903633', 139, 2, NULL, 'Penang', NULL, 'pheiling95', NULL, 1602929521, NULL);
