INSERT INTO `sp_show` VALUES (59, '215796164', '3915267163', 'OXBOW‚Ñ¢ ESSENTIALS Adult Guinea Pig Food - 10lbs (4.53kg)', '13 Sold', NULL, 'RM107.90', 'Oxbow‚Äôs Essentials - Adult Guinea Pig Food is formulated to meet the specific nutritional needs of adult guinea pigs and help them thrive. This complete and balanced adult guinea pig food contains Timothy hay for healthy digestion and all the wholesome ingredients and vital nutrients needed to support daily function and performance.\nKey Features:\n\n‚óè Uniform pellets prevent selective feeding\n‚óè High in fiber for daily digestive health\n‚óè Fortified with vitamins and minerals for optimum health\n‚óè Formulated with the guidance of top veterinarians and nutritionistsSeventy percent of your guinea pig\'s diet should be grass hay. Oxbow offers a variety of hand-selected, high-fiber hays to enrich the life and health of your pet.\nPet Food Specs\nLife Stage\n\n‚óè Adult\nIngredients\n\n‚óè Timothy Grass Meal, Soybean Hulls, Soybean Meal, Cane Molasses, Wheat Middlings, Sodium Bentonite\n‚óè Soybean Oil, Salt, Lignin Sulfonate, L-Ascorbyl-2-Monophosphate (Vitamin C), Monocalcium Phosphate\n‚óè Choline Chloride, Vitamin E Supplement, Zinc Sulfate, Yeast Culture, Hydrolyzed Yeast, Zinc Proteinate\n‚óè Niacin, Copper Sulfate, d-Calcium Pantothenate, Manganous Oxide, Riboflavin Supplement, Biotin\n‚óè Thiamine Mononitrate, Magnesium Sulfate, Copper Proteinate, Vitamin A Supplement, Sodium Selenite\n‚óè Manganese Proteinate, Pyridoxine Hydrochloride, Folic Acid, Vitamin D3 Supplement, Cobalt Carbonate\n‚óè Vitamin B12 Supplement, Calcium Iodate\nGuaranteed Analysis\n\n‚óè Crude Protein (min) 14.00%\n‚óè Crude Fat (min) 2.00%\n‚óè Crude Fiber (min) 25.00%\n‚óè Crude Fiber (max) 28.00%\n‚óè Moisture (max) 10.00%\n‚óè Calcium (min) 0.35%\n‚óè Calcium (max) 0.75%\n‚óè Phosphorus (min) 0.25%\n‚óè Vitamin A (min) 10,000 IU/kg\n‚óè Ascorbic Acid (Vit C.) (min) 250 mg/kg\n‚óè Vitamin D3 (min) 900 IU/kg\n‚óè Vitamin E (min) 190 IU/kg\nDirections\n*Please note that these are guidelines. If your guinea pig is overweight or underweight, please contact your veterinarian or Oxbow for more specific feeding information.\nMature Guinea Pigs (over 6 months)\n\n‚óè Feed 1/8 cup pellets daily in addition to unlimited grass hay.\n‚óè Although Essentials - Adult Guinea Pig Food is an excellent complete feed for guinea pigs, unlimited access to fresh grass hay should also be provided.\n‚óè Cavy Cuisine - Adult Guinea Pig Food is not intended for growing, gestating or lactating animals.Transitioning to a New Food:\n\n‚óè Week 1, mix 3 parts current food with 1 part new food.\n‚óè Week 2, mix 2 parts current food with 2 parts new food.\n‚óè Week 3, mix 1 part current food with 3 parts new food.\n‚óè Week 4, feed Essentials - Adult Guinea Pig exclusively.\nNote\n\n‚óè This product is not intended for growing, active, pregnant or nursing guinea pigs. We encourage pet owners to feed Oxbow Essentials Young Guinea Pig Food during these stages of life.\nSize\n\n* Volume Available : 5lbs (2.25kg), 10lbs (4.53kg).\n* PRODUCT OF THE USA.', '9 months', '[\"https://cf.shopee.com.my/file/708682f74f6433bc64949ef8a53c35df\"]', 'https://shopee.com.my/OXBOW%E2%84%A2-ESSENTIALS-Adult-Guinea-Pig-Food-10lbs-(4.53kg)-i.215796164.3915267163', 123, 2, 'Preferred', 'Selangor', NULL, 'amypets', NULL, 1602929521, NULL);
