INSERT INTO `sp_show` VALUES (63, '33632063', '7032236264', 'Oxbow Young Rabbit Food 10lb', '0 Sold', NULL, 'RM98.90', 'Oxbow√¢‚Ç¨‚Ñ¢s Essentials - Young Rabbit Food is formulated to meet the specific nutritional needs of young rabbits and help them thrive. This complete and balanced young rabbit food contains Alfalfa hay to provide optimal protein and fiber for healthy digestion. We add wholesome ingredients and vital nutrients to support daily function and performance, making Essentials - Young Rabbit Food the ideal diet for young and growing rabbits. Sizes: 5 lb, 10 lb, 25 lb\r\nProduct Highlights:\r\nUniform pellets prevent selective feedingAlfalfa hay = high fiber, optimal protein sourceFortified with vitamins and minerals for optimum healthFormulated with the guidance of top veterinarians and nutritionistsSeventy-five percent of your rabbit\'s diet should be grass hay. Oxbow offers a variety of hand-selected, high-fiber hays to enrich the life and health of your pet.', '6 months', '[\"https://cf.shopee.com.my/file/076eb77205e72b2d5c39af7c0e823174\", \"https://cf.shopee.com.my/file/57dfdd9fe9772b40434c4d18c5e79908\"]', 'https://shopee.com.my/Oxbow-Young-Rabbit-Food-10lb-i.33632063.7032236264', 119, 2, NULL, 'Kuala Lumpur', NULL, 'petswonderland', NULL, 1602929521, NULL);
