INSERT INTO `sp_show` VALUES (65, '66511181', '3646817190', 'OXBOW YOUNG RABBIT FOOD - [SmallPacks]', '3 Sold', NULL, 'RM6.00 - RM28.00', 'Quality pellets for your fav fur animals! \n\nWant to feed them the best but retails packs are too much for you? Looking for smaller packs for your piggies? Look no more! \n\nWe understand that some owners do not need 2kg packs at one go, hence we will repack it for you so your guinea pigs can enjoy quality food :) \nIt\'s also good to buy smaller packs to let them try and see if they like it (we know some are very picky with their food ;)) \n\nOxbow‚Äôs Essentials - Young Rabbit Food is formulated to meet the specific nutritional needs of young rabbits and help them thrive.  This complete and balanced young rabbit food contains Alfalfa hay to provide optimal protein and fiber for healthy digestion.  We add wholesome ingredients and vital nutrients to support daily function and performance, making Essentials - Young Rabbit Food the ideal diet for young and growing rabbits.\n\nFEEDING GUIDE\n\nGrowing (under one year): Unlimited pellets daily in addition to unlimited grass hay.\n\nPregnant/Nursing: Unlimited pellets daily in addition to unlimited grass hay. Alfalfa hay may be given in small quantities.\n\n*Please note that these are guidelines. If your rabbit is overweight or underweight, please contact your veterinarian or Oxbow for more specific feeding information.\n\n', '2 months', '[\"https://cf.shopee.com.my/file/467eedc1466428b31d31015f71951e61\", \"https://cf.shopee.com.my/file/862aad3101b6b13ead26c06568b7971e\"]', 'https://shopee.com.my/OXBOW-YOUNG-RABBIT-FOOD-SmallPacks--i.66511181.3646817190', 117, 2, NULL, 'Selangor', NULL, 'baeleaf', NULL, 1602929521, NULL);
