INSERT INTO `sp_show` VALUES (68, '26786712', '2882956234', 'Oxbow Natural Science Skin & Coat Supplement 120g', '6 Sold', 'RM63.90', 'RM58.00', 'Best by: 02/2021\n\nPromote your small pet\'s skin and coat health with Oxbow Natural Science Skin & Coat Small Animal Supplement. Small pets including Guinea Pigs, rabbits, hamsters, gerbils and chinchillas are living longer because of better care and nutrition. As they age, the most common ailments reported are related to digestive, urinary, joint and skin and coat issues. Oxbow Natural Science Skin & Coat Small Animal Supplement contains chamomile to soothe the skin. Depending on weight, feed rabbits, Guinea Pigs and chinchillas ¬Ω to 2 tabs a day, rats ¬º tab a day and hamsters and gerbils 1/8 tab. It is not recommended for mice.\n\nKey Benefits\n- Produced with a hay-based formula, this product is high in fiber which will help support an overall healthier system.\n- Specifically made to promote skin and coat health in small animals. Help deter skin problems and ensure your pet\'s coat will look it best.\n- Formulated with chamomile to soothe the skin, this product is also made to help prevent cell damage while also supporting anti-aging properties.\n- Made with all-natural ingredients to specifically support a small animal\'s overall health. There are no artificial flavors, colors or preservatives.\n- Perfect for small animals like Guinea Pigs, rabbits, hamsters, gerbils and chinchillas.\n\nPrecautions\n- NOT RECOMMENDED FOR MICE. Not intended for growing, pregnant, or lactating animals.\n\nNew look, same great formula! This product has recently undergone a packaging change. Customers may receive old packaging during this transition.', '13 months', '[\"https://cf.shopee.com.my/file/7fdad8997021b74c2732c6fe0fab57ff\"]', 'https://shopee.com.my/Oxbow-Natural-Science-Skin-Coat-Supplement-120g-i.26786712.2882956234', 114, 2, NULL, 'Pahang', NULL, 'meowheaven', NULL, 1602929521, NULL);
INSERT INTO `sp_show` VALUES (69, '26786712', '2882807007', 'Oxbow Young Guinea Pig Food 5lbs/2.25kg', '14 Sold', 'RM60.90', 'RM55.00', 'Best by: 01/2021\n\nDescription\nFeed your young Guinea Pig a diet that provides the essential fiber and nutrients needed to grow strong and healthy with Oxbow Essentials Cavy Performance Young Guinea Pig Food. Growing Guinea Pigs require more protein, calcium and energy than adults. And like adult Guinea Pigs, they need Vitamin C from their diet to stay healthy. Oxbow Essentials Cavy Performance Young Guinea Pig Food is specially designed to provide the high fiber, protein, calcium and energy required for young Guineas under six months to thrive. It is made with succulent alfalfa hay and a stabilized form of Vitamin C. Feed an unlimited supply of pellets daily with an unlimited supply of grass hay.\n\nKey Benefits\n- Specially formulated to mirror a young Guinea Pig\'s natural diet. This will ensure that your pet lives a healthy lifestyle. - Not recommended feed for adult Guinea Pigs\n- Fortified with stabilized Vitamin C, help ensure that your pet\'s immunity system is in tip-top shape.\n- Includes high-fiber grass hay that promotes healthy gastrointestinal health. Contains lower levels of protein, calories and calcium than alfalfa-based pellets\n- 75% of your guinea pig‚Äôs diet should be grass hay and Guinea Pig is not intended for growing, gestating or lactating guinea pigs.\n\nMade of high-quality, all natural hay', '13 months', '[\"https://cf.shopee.com.my/file/9a0464926abe07d5e37b825937c7aa54\", \"https://cf.shopee.com.my/file/69a931ca688471ca2fdaaf648c17d361\"]', 'https://shopee.com.my/Oxbow-Young-Guinea-Pig-Food-5lbs-2.25kg-i.26786712.2882807007', 113, 2, NULL, 'Pahang', NULL, 'meowheaven', NULL, 1602929521, NULL);
