INSERT INTO `sp_show` VALUES (84, '238879937', '5242965700', 'Oxbow Natural Science Vitamin C (4.2 oz) - 120g', '14 Sold', 'RM63.90', 'RM60.70', 'Natural Science Vitamin C supplement is a hay-based, high-fiber supplement containing the essential stabilized vitamin C that guinea pigs need and other animals benefit from to promote overall health.\n\nGuaranteed Analysis:\nCrude Protein (min) 10.00%\nCrude Fat (min) 5.00%\nCrude Fiber (min) 9.00%\nCrude Fiber (max) 12.00%\nMoisture (max) 8.00%\nAsh (max) 8.00%\nCalcium (min) 0.50%\nCalcium (max) 0.70%\nPhosphorus (min) 0.50%\nCopper (min) 9 mg/kg\nAscorbic Acid (Vitamin C) (min) 25 mg\n\nIngredients:\nTimothy Grass, Barley Flour, Oat Groat Flour, Cane Molasses, L-Ascorbyl-2-Monophosphate (Vitamin C), Flax Seed Meal, Brewers Dried Yeast, Guar Gum, Fat Product, Mixed Tocopherols (preservative), Rosemary Extract\n\nFeeding Directions:\n\nWhen adding supplements to your pet‚Äôs diet, consult your veterinarian.\n\nRabbits, Guinea Pigs, and Chinchillas (all weights): 1 tab per day\nRats and Degus (all weights): 1/4 tab per day\nOther Species: Contact Oxbow or consult your veterinarian\n\n*In times of stress, Vitamin C requirements may increase. Please consult your veterinarian for more information.', '3 months', '[\"https://cf.shopee.com.my/file/762fd41157f5e15e97173c4f8fffc49c\", \"https://cf.shopee.com.my/file/3866db21471ea60aad9bec044690d215\"]', 'https://shopee.com.my/Oxbow-Natural-Science-Vitamin-C-(4.2-oz)-120g-i.238879937.5242965700', 95, 3, 'Preferred', 'Selangor', NULL, 'behnyo', NULL, 1602929521, NULL);
