INSERT INTO `sp_show` VALUES (94, '236670489', '5531545370', 'Brit Animals - Rabbit Adult 1.5kg | Rabbit Food | Makanan Rabbit |', '0 Sold', NULL, 'RM58.00', 'Brand : Brit Animals\n\nItem : Brit Animals RABBIT ADULT Complete\n\nSuper premium complete food for adult rabbits (20 weeks ‚Äì 4 years of age). Optimal ratio of proteins, fats, and fiber ensures ideal digestibility and nutritional value of the food for the adult period. Milk thistle (Silybum marianum) support the proper liver function and helps to prevent most often metabolic diseases. Complete in vitamins & nutrients for vitality & great condition.\n\nVariants : 1.5kg\n\nComposition:\n\nalfalfa, herbs (nettle, dandelion, plantain), dried apples, barley, carrot, corn, wheat, linseed, brewer¬¥s yeast, mannan-oligosaccharides (75 mg/kg), fructo-oligosaccharides (50 mg/kg), milk thistle (50 mg/kg), Yucca schidigera extract (45 mg/kg).\n\nAnalytical ingredients:\n\ncrude protein 14,0 %, crude fat 2,8 %, crude fiber 20,0 %, crude ash 8,4 %, moisture 10,0 %, calcium 0,7 %, phosphorus 0,4 %, sodium 0,06 %.\n\nNutritional composition:\n\nvitamin A10 200 I.U., vitamin D3 1 250 I.U., vitamin E (Œ±-tocopherol) 70 mg, vitamin C 80 mg, vitamin K 0,1 mg, vitamin B1 1 mg, vitamin B2 2 mg, vitamin B3 6 mg, vitamin B5 3,5 mg, vitamin B6 1 mg, vitamin B9 0,12 mg, vitamin B12 0,02 mg, biotin 1 mg, choline-chloride 200 mg, zinc 72 mg, iron 40 mg, manganese 54 mg, copper 10 mg, iodine 1,8 mg, selenium 0,21 mg.\n\nMetabolizable energy:\n\n2 300 kcal/kg.', '6 months', '[\"https://cf.shopee.com.my/file/a86c0296b75410b62ffa1c1581763574\", \"https://cf.shopee.com.my/file/b2bf57fd3bf57c1641d3dda73b6be3dd\"]', 'https://shopee.com.my/Brit-Animals-Rabbit-Adult-1.5kg-Rabbit-Food-Makanan-Rabbit--i.236670489.5531545370', 85, 3, NULL, 'Penang', NULL, 'pawsitivepetz', NULL, 1602929521, NULL);
