an occasional treat.\n\n* Product Volume : 3lbs (1.36kg), 10lbs (4.53kg).\n* PRODUCT OF THE USA.\n\nhttps://www.facebook.com/EcoSpherePetOnlineStore/', '15 months', '[\"https://cf.shopee.com.my/file/2e9283d4da7a4131619ee3994021003a\", \"https://cf.shopee.com.my/file/311245b56f4650231dd75ac067525e94\"]', 'https://shopee.com.my/OXBOW%E2%84%A2-ESSENTIALS-Chinchilla-Food-3lbs-(1.36kg)-i.73054533.2584887836', 81, 3, 'Preferred', 'Kuala Lumpur', NULL, 'ecosphere_pet_online_store', NULL, 1602929521, NULL);
