entonite, Hydrolyzed Yeast, Mixed Tocopherols (preservative), Citric Acid, Soy Oil, Choline Chloride, Vitamin E Supplement, Zinc Sulfate , Zinc Proteinate, Niacin, Copper Sulfate, d-Calcium Pantothenate, Manganous Oxide, Riboflavin Supplement, Biotin, Thiamine Mononitrate, Magnesium Sulfate, Copper Proteinate, Vitamin A Supplement, Sodium Selenite, Manganese Proteinate, Pyridoxine Hydrochloride, Folic Acid, Vitamin D3 Supplement, Cobalt Carbonate, Vitamin B12 Supplement, Calcium Iodate, Rosemary Extract\n\nGuaranteed Analysis\n\nCrude Protein (min) 15.00%\nCrude Fat (min) 4.50%\nCrude Fiber (min) 10.00%\nCrude Fiber (max) 15.00%\nMoisture (max) 10.00%\nCalcium (min) 0.60%\nCalcium (max) 1.00%\nPhosphorus (min) 0.40%\nVitamin A (min) 10,000 IU/kg\nVitamin D3 (min) 900 IU/kg\nVitamin E (min) 190 IU/kg', '5 months', '[\"https://cf.shopee.com.my/file/820d569867c99edf7bb7f904d83b4063\", \"https://cf.shopee.com.my/file/bcb88a9c21dbbf8974721aac7b653d0e\"]', 'https://shopee.com.my/%E5%90%83%E8%B4%A7fun%E9%BC%A0-%EF%BC%BB%E4%BB%93%E9%BC%A0%E7%B2%AE%EF%BC%BDOxbow-%E7%A3%A8%E7%89%99%E7%B2%AE-%E5%8E%9F%E8%A3%851lb-(454g)-Best-by-13-April-2022-i.59713284.5132515939', 78, 3, NULL, 'Johor', NULL, 'ecfunchew', NULL, 1602929521, NULL);
