INSERT INTO `sp_show` VALUES (105, '237640102', '5731279690', 'Oxbow Natural Science Critical Care - 36gm', '2 Sold', NULL, 'RM29.00', 'Developed with the assistance of top exotics veterinarians and nutritionists, Critical Care is the industry standard in recovery nutrition for herbivores with poor nutritional status resulting from illness or surgery.  Critical Care contains all the essential nutrients of a complete diet, as well as high-fiber timothy hay to support proper gut physiology and digestion.\n\nProduct Highlights:\n\nPowdered formula mixes easily to desired consistency\nHighly versatile ‚Äì can be tube fed, assist-fed by syringe or spoon, or self-fed by bowl or as top dressing\nHigh in fiber; low in carbohydrates\nContains readily-absorbable chelated minerals and beneficial prebiotics\nNo refined sugars, artificial preservatives or simple carbohydrates\nHigh digestibility and palatability\nContains stabilized form of Vitamin C', '6 months', '[\"https://cf.shopee.com.my/file/16e5366b6f8e4eefa404f6fdfa989ac4\"]', 'https://shopee.com.my/Oxbow-Natural-Science-Critical-Care-36gm-i.237640102.5731279690', 74, 3, NULL, 'Selangor', NULL, 'atozpetstore', NULL, 1602929521, NULL);
