INSERT INTO `sp_show` VALUES (111, '73054533', '2731562588', 'OXBOW‚Ñ¢ Western Timothy Hay 15oz (425g)', '66 Sold', 'RM32.90', 'RM31.25', 'OXBOW‚Ñ¢ Western Timothy Hay\n***[Freshest by : 17/04/2022]***\n\nFEATURES :\n> A nutritious & sweet-smelling grass \n> Harvested fresh from our family of farms.\n> No artificial colors, flavors, or preservatives.\n> Stimulate the appetite of your small pet.\n> With high fiber, low protein & low calcium content \n> Provides essential fiber to support digestive & dental health.\n> Hand-sorted and hand-packed with care.\n> Recommended by veterinarians worldwide.\n> Ideal for rabbits, guinea pigs, chinchillas, prairie dogs, gerbils, hamsters, mice, rats & other small pets.\n\nINGREDIENTS :\nTimothy Grass Hay.\n\nGUARANTEED ANALYSIS :\n- Crude Protein (min) 7.00%\n- Crude Fat (min) 1.50%\n- Crude Fiber (max) 32.00%\n- Moisture (max) 15.00%\n\nSUGGESTED FEEDING :\n1. Place large handfuls of grass hay in your pet‚Äôs habitat daily.\n2. Mix different grass hays together to enrich your pet‚Äôs diet.\n3. Try all tastes and textures to discover your pet‚Äôs favorites.\n\n* Product Volume Available : 15oz (425g), 40oz (1.13kg).\n* GRASS GROWN IN THE USA.\n\nhttps://www.facebook.com/EcoSpherePetOnlineStore/', '14 months', '[\"https://cf.shopee.com.my/file/bacb687e80d2834b4a25bda7af0b8620\"]', 'https://shopee.com.my/OXBOW%E2%84%A2-Western-Timothy-Hay-15oz-(425g)-i.73054533.2731562588', 68, 3, 'Preferred', 'Kuala Lumpur', NULL, 'ecosphere_pet_online_store', NULL, 1602929521, NULL);
