INSERT INTO `sp_show` VALUES (115, '66511181', '7245436337', 'OXBOW Young Guinea Pig Pellets - [Small Packs]', '18 Sold', NULL, 'RM11.00 - RM32.00', 'Quality pellets for your fav fur animals! \n\nWant to feed them the best but retails packs are too much for you? Looking for smaller packs for your piggies? Look no more! \n\nWe understand that some owners do not need 2kg packs at one go, hence we will repack it for you so your guinea pigs can enjoy quality food :) \nIt\'s also good to buy smaller packs to let them try and see if they like it (we know some are very picky with their food ;)) \n\n *Suitable for 6mths old and below guinea pigs only\n\nOxbow‚Äôs Essentials - Young Guinea Pig Food is formulated to meet the specific nutritional needs of young, pregnant, and nursing guinea pigs and help them thrive.¬† This complete and balanced young guinea pig food contains Alfalfa hay to provide optimal energy and the fiber essential for healthy digestion.¬† We then add wholesome ingredients and vital nutrients to meet the growth, energy, pregnancy, and nursing needs of guinea pigs.\n\nProduct Highlights:\n\nUniform pellets prevent selective feeding\n\nContains alfalfa to meet energy needs of young, pregnant, and nursing guinea pigs\n\nFortified with vitamins and minerals for optimum health\n\nFormulated with the guidance of top veterinarians and nutritionists\n\n', '2 months', '[\"https://cf.shopee.com.my/file/ea2d8764962259a1384740d7659339d6\", \"https://cf.shopee.com.my/file/7bf5c6d91f08f1b7daa1c1a11ef3ee30\"]', 'https://shopee.com.my/OXBOW-Young-Guinea-Pig-Pellets-Small-Packs--i.66511181.7245436337', 63, 3, NULL, 'Selangor', NULL, 'baeleaf', NULL, 1602929521, NULL);
INSERT INTO `sp_show` VALUES (116, '300342016', '6555559300', 'Oxbow Adult Rabbit Food', '0 Sold', NULL, 'RM62.88', 'Made from timothy grass meal, Bunny Basics ‚Äì Adult Rabbit is specifically designed to meet the particular nutritional needs of adult rabbits. Adult nutritional needs are lower than those of animals in the growth stage of life.\n\nRabbits are designed to eat and digest fiber found in plant material. Timothy grass hay provides the fiber necessary to maintain intestinal health, and makes Bunny Basics ‚Äì Adult Rabbit the veterinarian‚Äôs number one choice for your adult rabbit.\n‚Ä¢Timothy hay-based\n‚Ä¢Optimum protein level\n‚Ä¢Ideal diet for adult rabbits\n‚Ä¢Recommended by veterinarians\n‚Ä¢Balanced calcium to phosphorus ratio\n‚Ä¢High fiber from quality digestible ingredients\n‚Ä¢Fresh! Straight from the farm!\n\nPremium Ingredients:\n‚Ä¢Timothy Hay = Essential Fiber\n‚Ä¢Soy Products = Fiber, Balanced Protein, Healthy Fat\n‚Ä¢Wheat = Ideal Carbohydrate and Energy Source\n\nIngredients:\nTimothy Grass Meal, Soybean Hulls, Wheat Middlings, Soybean Meal, Cane Molasses, Sodium Bentonite, Soybean Oil, Salt, Lignin Sulfonate, Limestone, Yeast Culture (dehydrated), Vitamin E Supplement, Choline Chloride, Zinc Proteinate, Zinc Sulfate, Ferrous Sulfate, Niacin, Copper Sulfate, Selenium Yeast, Vitamin A Supplement, Folic Acid, d-Calcium Pantothenate, Copper Proteinate, Riboflavin Supplement, Manganese Proteinate, Biotin, Manganous Oxide, Thiamine Mononitrate, Magnesium Sulfate, Vitamin B12 Supplement, Sodium Selenite, Pyridoxine Hydrochloride, Cobalt Carbonate, Vitamin D3 Supplement, Calcium Iodate\n\nGuaranteed Analysis:\n‚Ä¢Crude Protein min 14.00%\n‚Ä¢Crude Fat min 2.00%\n‚Ä¢Crude Fiber min 25.00%\n‚Ä¢Crude Fiber max 29.00%\n‚Ä¢Moisture max 10.00%\n‚Ä¢Calcium min 0.35%\n‚Ä¢Calcium max 0.85%\n‚Ä¢Phosphorus min 0.25%\n‚Ä¢Salt min 0.50%\n‚Ä¢Salt max 1.00%\n‚Ä¢Copper (min) 30 ppm\n‚Ä¢Vitamin A (min) 19,000 IU/kg\n‚Ä¢Vitamin D (min) 900 IU/kg\n‚Ä¢Vitamin E (min) 190 IU/kg\n\nFeeding Directions:\nMature Rabbits (over 1 year)\n1-4 lbs = 1/8 cup daily\n4-8 lbs = 1/4-1/3 cup daily\n8-10 lbs = 1/3-1/2 cup daily\n10 lbs+ = 3/4 cup daily\nFeed in addition to unlimited grass hay.\n\nProduct Weight: 5lb (2.25kg)', '13 days', '[\"https://cf.shopee.com.my/file/aa2b4e5bdaaa4d59b2aa42589dc1d069\", \"https://cf.shopee.com.my/file/3085df35b5ce13f20567ce66fc44f43d\"]', 'https://shopee.com.my/Oxbow-Adult-Rabbit-Food-i.300342016.6555559300', 62, 3, NULL, 'Melaka', NULL, 'catng8888', NULL, 1602929521, NULL);
