INSERT INTO `sp_show` VALUES (127, '259516429', '5142350127', 'Oxbow Critical Care Anise Rabbit Guinea Pig Small Herbivores 36g (Long Expiry)', '20 Sold', NULL, 'RM30.00', 'Developed with the assistance of top exotics veterinarians and nutritionists, Critical Care is the industry standard in recovery nutrition for herbivores with poor nutritional status resulting from illness or surgery. Critical Care contains all the essential nutrients of a complete diet, as well as high-fiber timothy hay to support proper gut physiology and digestion.\nKey Features:\n\n‚óè Powdered formula mixes easily to desired consistency\n‚óè Highly versatile ‚Äì can be tube fed, assist-fed by syringe or spoon, or self-fed by bowl or as top dressing\n‚óè High in fiber; low in carbohydrates\n‚óè Contains readily-absorbable chelated minerals and beneficial prebiotics\n‚óè No refined sugars, artificial preservatives or simple carbohydrates\n‚óè High digestibility and palatability\n‚óè Contains stabilized form of Vitamin C\n‚óè Anise Flavor', '3 months', '[\"https://cf.shopee.com.my/file/6039179947bd1696b3ef52bbc34ad7cd\"]', 'https://shopee.com.my/Oxbow-Critical-Care-Anise-Rabbit-Guinea-Pig-Small-Herbivores-36g-(Long-Expiry)-i.259516429.5142350127', 22, 1, 'Preferred', 'Selangor', NULL, 'petlovershop', NULL, 1602929521, NULL);
INSERT INTO `sp_show` VALUES (128, '238879937', '3421525000', 'Oxbow Natural Science Papaya Support (1.16 oz) - 33 g', '37 Sold', 'RM63.90', 'RM60.70', 'Oxbow\'s Natural Science Papaya Support is designed to support the digestive health of your pet. Premium ingredients include papaya and pineapple (natural sources of the active enzymes, papain and bromelain) and high fiber timothy hay.\n\nIngredients:\nTimothy Grass, Cellulose, Dicalcium Phosphate, Papaya Fruit Powder, Pineapple Fruit Powder, Bromelain, Stearic Acid, Magnesium Stearate, Papain\n\nGuaranteed Analysis:\nPer 0.55g tab unless otherwise specified\n\nCrude Protein (min) 4.00%\nCrude Fat (min) 1.00%\nCrude Fiber (min) 20.00%\nCrude Fiber (max) 25.00%\nMoisture (max) 10.00%\nBromelain (from Pineapple) 19.2 mg (Providing 2,400 GDU*/g Activity)\nPapain (from Papaya) 2.0 mg (Providing 50,000 PU**/mg Activity)\n\n*Gelatin Digestion Unit - quantity of enzyme which whill hydrolyze 1 mg of amino nitrogen from gelatin in 20 minutes at pH 4.5 and 45 degrees Celcius\n\n**Papain Unit - quantity of enyzme which will hydrolyze 1 mg of tyrosine in 60 minutes at pH 6.0 and 40 degrees Celcius.\n\nFeeding Directions:\nWhen adding supplements to your pet\'s daily regimen, consult your veterinarian.\n\nRabbits, Guinea Pigs, and Chinchillas: 1-2 tablets per day\nOther Small Animals: 1/2 tablet per day\n\n*Not intended for growing, pregnant, lactating or food producing animals.', '7 months', '[\"https://cf.shopee.com.my/file/a03e82fef63ce60f06ba9d30c33437ae\", \"https://cf.shopee.com.my/file/c48791eb4fef743d23435a78353fde14\"]', 'https://shopee.com.my/Oxbow-Natural-Science-Papaya-Support-(1.16-oz)-33-g-i.238879937.3421525000', 21, 1, 'Preferred', 'Selangor', NULL, 'behnyo', NULL, 1602929521, NULL);
INSERT INTO `sp_show` VALUES (129, '59713284', '6732453419', 'ÂêÉË¥ßfunÈº†Ôºª‰ªìÈº†Á≤Æ]ÔºªÂàÜË£Ö ÔºΩOxbow Á£®ÁâôÁ≤Æ', '62 Sold', NULL, 'RM6.00', 'Oxbow‚Äôs Essentials - Hamster & Gerbil Food is formulated with the guidance of top exotics veterinarians to meet your pet hamster or gerbil‚Äôs unique nutritional needs. We combine hand-selected Timothy Hay with wholesome barley and oats to provide vital nutrients that support daily function and performance in hamsters and gerbils.\n\nProduct Highlights:\n\n#Uniform kibble prevents selective feeding \n#Supports daily function and performance in hamsters and gerbils\n#Fortified with vitamins and minerals for optimum health\n#Formulated with the guidance of top veterinarians and nutritionists\n\nFEEDING DIRECTION & ADDITIONAL TIPS \nYoung (under six months) or Pregnant / Nursing Small Hamster or Gerbil/Large Hamster: Unlimited\nAdult (over six months) Small Hamster: 1/8 cup\nAdult (over six months) Gerbil/Large Hamster: 1/3 cup\n* Please note that these are guidelines.  If your hamster or gerbil is overweight or underweight, please contact your veterinarian or Oxbow for more specific feeding information.\n\nNote: Hamsters are known to hoard and hide their food, particularly females or those housed with other hamsters.  Be sure to check for stockpiles of food and adjust daily rations as required.\n\nWhile hamsters and gerbils don‚Äôt require hay as a staple in their diet, be sure to offer them free choice hay to burrow and hide in.\n\nTransitioning Foods: \nWeek One, mix ¬º new food with ¬æ current food.  \nWeek Two, mix ¬Ω new food with ¬Ω current food.  \nWeek Three, mix ¬æ new food with ¬º current food.  By \nWeek Four, you can feed Oxbow Essentials Hamster and Gerbil Food exclusively to your pet.\n\nINGREDIENTS & GUARANTEED ANALYSIS \nTimothy Meal, Pearled Barley (Rolled), Oat Groats, Canola Meal, Millet, Canola Oil, Wheat Gluten, Calcium Carbonate, Salt, Brewer\'s Dried Yeast, Sodium Bentonite, Hydrolyzed Yeast, Mixed Tocopherols (preservative), Citric Acid, Soy Oil, Choline Chloride, Vitamin E Supplement, Zinc Sulfate , Zinc Proteinate, Niacin, Copper Sulfate, d-Calcium Pantothenate, Manganous Oxide, Riboflavin Supplement, Biotin, Thiamine Mononitrate, Magnesium Sulfate, Copper Proteinate, Vitamin A Supplement, Sodium Selenite, Manganese Proteinate, Pyridoxine Hydrochloride, Folic Acid, Vitamin D3 Supplement, Cobalt Carbonate, Vitamin B12 Supplement, Calcium Iodate, Rosemary Extract\n\nGuaranteed Analysis\n\nCrude Protein (min) 15.00%\nCrude Fat (min) 4.50%\nCrude Fiber (min) 10.00%\nCrude Fiber (max) 15.00%\nMoisture (max) 10.00%\nCalcium (min) 0.60%\nCalcium (max) 1.00%\nPhosphorus (min) 0.40%\nVitamin A (min) 10,000 IU/kg\nVitamin D3 (min) 900 IU/kg\nVitamin E (min) 190 IU/kg', '5 months', '[\"https://cf.shopee.com.my/file/5f4bc60c1c85c54224fe833928e7a035\", \"https://cf.shopee.com.my/file/f56751bf659da6f38efd58d5c98a5a24\"]', 'https://shopee.com.my/%E5%90%83%E8%B4%A7fun%E9%BC%A0%EF%BC%BB%E4%BB%93%E9%BC%A0%E7%B2%AE-%EF%BC%BB%E5%88%86%E8%A3%85-%EF%BC%BDOxbow-%E7%A3%A8%E7%89%99%E7%B2%AE-i.59713284.6732453419', 20, 1, NULL, 'Johor', NULL, 'ecfunchew', NULL, 1602929521, NULL);
INSERT INTO `sp_show` VALUES (130, '11079394', '5053255785', 'Brit Animals Hamster Food 100g', '10 Sold', NULL, 'RM8.00', 'Super Premium Complete Food for Hamsters. Safe nutrition ‚Äì contains essential vitamins and nutrients. Contains linseed - a source of omega-3 unsaturated fatty acids for shiny hair.\n\nComposition:\n\nwheat, corn, wheat sprouts, herbs (nettle, dandelion, plantain), dried apples, alfalfa, spinach, brewer¬¥s yeast, linseed, limestone, mannan-oligosaccharides (75 mg/kg), fructo-oligosaccharides (50 mg/kg), Yucca schidigera extract (45 mg/kg).\n\nAnalytical ingredients:\n\ncrude protein 17,0 %, crude fat 4,5 %, crude fiber 5,0 %, crude ash 4,0 %, moisture 10,0 %, calcium 0,6 %, phosphorus 0,6 %, sodium 0,03 %.\n\nNutritional composition:\n\nvitamin A 10 200 I.U., vitamin D3 1 250 I.U., vitamin E (Œ±-tocopherol) 70 mg, vitamin C 80 mg, vitamin K 0,1 mg, vitamin B1 1 mg, vitamin B2 2 mg, vitamin B3 6 mg, vitamin B5 3,5 mg, vitamin B6 1 mg, vitamin B9 0,12 mg, vitamin B12 0,02 mg, biotin 1 mg, choline-chloride 200 mg, zinc 72 mg, iron 40 mg, manganese 54 mg, copper 10 mg, iodine 1,8 mg, selenium 0,21 mg.\n\nMetabolizable energy:\n\n3 100 kcal/kg.\n\n#britcare #hamster', '28 days', '[\"https://cf.shopee.com.my/file/b98233599bb82eb2f1db2c1856de9b57\"]', 'https://shopee.com.my/Brit-Animals-Hamster-Food-100g-i.11079394.5053255785', 19, 1, 'Preferred', 'Johor', NULL, 'xiiaowei_95', NULL, 1602929521, NULL);
INSERT INTO `sp_show` VALUES (131, '238879937', '7625115923', 'Oxbow Pure Comfort Small Animal Bedding (White) - 72 L', '41 Sold', 'RM102.90', 'RM97.75', 'Pure, soft, and white as snow! Oxbow‚Äôs Pure Comfort White bedding is made of 100% pure, never-printed paper to create a clean, safe, and ultra-soft bedding material for pets of all sizes. Pure Comfort provides superb odor control and moisture absorption, making clean up easy.\n\n- Odor Absorbent to minimize pet odors\n- Moisture Absorbent for easy cleanup\n- 99.9% Dust Free\n- Pure, Never-printed Paper Bedding is soft, hygienic and safe\n\nDirections for Use:\nPlace 1-3 inches of Pure Comfort bedding on the floor of your pet‚Äôs enclosure. Check daily for soiled areas. Remove and replace all bedding at least once a week, or more frequently as needed.\n\nSize: 72L (4394 cu in)\n\nWhat does 72L mean?\n72L is expanded volume, which is the whole package of the compressed bedding could fill up the space in non compressed condition. It can help consumer to understand how much bedding is needed to fill up the cage. Why they don‚Äôt use weight, is because, different material have different expandable characteristics. 1 kg wood pellet compared to 1 kg of paper bedding, the expanded volume is totally different.', '6 months', '[\"https://cf.shopee.com.my/file/6325b998586298771bfba7f4f88376d9\", \"https://cf.shopee.com.my/file/407f5e0c01731d9e7e0e5419cccce2b9\"]', 'https://shopee.com.my/Oxbow-Pure-Comfort-Small-Animal-Bedding-(White)-72-L-i.238879937.7625115923', 18, 1, 'Preferred', 'Selangor', NULL, 'behnyo', NULL, 1602929521, NULL);
